import React, { useEffect } from 'react';
import './App.css';
import DisplayCard from './DisplayCard';
import displayCard from './DisplayCard';
import { Service } from './Service';

function App() {

  const [recipes, setRecipes] = React.useState([]);
  useEffect(() => {
    Service.getRecipes().then(data=>{
      setRecipes(data);
    })
  },[]) 
  return (
    <div className="App">
      {recipes.map(recipe => (
        <DisplayCard 
        url = {recipe.image}
        name = {recipe.name}
        price = {recipe.price}
        />
      ))}
    </div>
  );
}

export default App;
